import './App.css';

export function App(prap) {
  return (
      <div className={prap.name} id={prap.id}><a href={prap.path}>{prap.content}</a></div>
  );
}
export function left_side_f(prop) {
    return (
        <div>
        <section id={prop.id} className={prop.sname}>
            <div className={prop.iname}>
                <h4>Blog post #{prop.postNumber}</h4>
                <p>
                    My <strong>{prop.order} blog post</strong> is all about my <span>blog post</span> and how to write a new
                    post in my<br/>blog,
                    you find it <a href="#here">here</a>
                </p>
                <br/>
                <br/>
                <p>
                    published {prop.numberOfDays} days ago by israel
                </p>
            </div>
            <div className="box">
                <div className="line1"></div>
                <div className="line2"></div>
            </div>
        </section>
        <br/>
        </div>
        );
}
